@Dansk-hygge

Hvis du klikker på detaljer( i Azureus i hvert fald), så vil du kunne se, at ingen endnu er nået mere end 74% og eftersom jeg var en af de første og kan hente med ca 1.4 mb/s. Så skulle jeg mene at ingen har hentet den helt endnu.
Men whatever.. Takker for Uppet.. og skal nok seede et par dage endnu, når jeg får den hentet
